class DB():

    def __init__(self, path):
        if not os.path.exists(path):
            raise

        self.con = sqlite3.connect(path)
        self.con.row_factory = DB._make_dicts

        params = self.con.execute('SELECT * FROM parameters').fetchone()
        self.photos_db_path  = params['photos_db_path']
        self.photos_lib_path = params['photos_lib_path']
        self.keypath         = params['keypath']

    @staticmethod
    def create(new_db_path, photos_db_path, photos_lib_path):
        '''initialize our photos database if one doesn't already exist.'''
        if os.path.exists(new_db_path) or not os.path.exists(photos_db_path):
            raise

        photos_db = sqlite3.connect(photos_db_path)
        photos_db.row_factory = DB._make_dicts
        new_db = sqlite3.connect(new_db_path)
        new_db.row_factory = DB._make_dicts

        new_db.execute("""
        CREATE TABLE 
        photos 
        (id          INTEGER PRIMARY KEY AUTOINCREMENT,
         rkmaster_id INTEGER, /* apple's id */ 
         filename    TEXT,
         clarifai    INTEGER,
         rekognition INTEGER,
         google      INTEGER,
         watson      INTEGER,
         microsoft   INTEGER,
         CONSTRAINT apple_unique UNIQUE (rkmaster_id))""")

        new_db.execute("""
        CREATE TABLE 
        parameters
        (id              INTEGER PRIMARY KEY AUTOINCREMENT,
         photos_db_path  TEXT,
         photos_lib_path TEXT,
         keypath         INTEGER)""")

        new_db.execute("""
        CREATE TABLE
        labels
        (id         INTEGER PRIMARY KEY AUTOINCREMENT,
         photo_id   INTEGER,
         provider   TEXT,
         label      TEXT,
         confidence REAL,
         FOREIGN KEY (photo_id) REFERENCES photos(id),
         CONSTRAINT unique_label UNIQUE (photo_id, provider, label))""")

        # obtain the value of keyPath from the relevant trigger. 
        photos_db_cur = photos_db.cursor()
        cur = photos_db.execute("""
        SELECT sql 
        FROM sqlite_master 
        WHERE type = 'trigger' 
        AND name = 'RKVersion_stringNote_skIndexUpdateTrigger'""")
        keypath = re.search(r'(?P<keypath>\([\d]+\))', cur.fetchone()['sql']).groupdict()['keypath'][1:-1]

        new_db.execute("""
        INSERT INTO 
        parameters
        (photos_db_path, photos_lib_path, keypath)
        VALUES
        (?, ?, ?)""", (photos_db_path, photos_lib_path.rstrip('/'), keypath))

        photos_db.close()
        new_db.commit()
        new_db.close()

    @staticmethod
    def _make_dicts(cursor, row):
        return dict((cursor.description[idx][0], value)
            for idx, value in enumerate(row))

    def query(self, query, args=(), one=False):
        cur = self.con.execute(query, args)
        rv = cur.fetchall()
        cur.close()
        return (rv[0] if rv else None) if one else rv
        
    def sync(self):
        'synchronize our db with the photos.app db'

        masters_pfx = self.photos_lib_path + '/Masters'

        photos_db = sqlite3.connect(self.photos_db_path)
        photos_db.row_factory = DB._make_dicts
        cur       = photos_db.cursor()
        cur.execute("""
        SELECT RKMaster.modelId AS id, RKMaster.imagePath AS filename, RKVersion_stringNote.value AS note
		FROM RKVersion_stringNote 
		INNER JOIN RKMaster 
		ON RKVersion_stringNote.attachedToId = RKMaster.modelId
        WHERE RKVersion_stringNote.keyPath = ?""", [self.keypath])

        for row in cur.fetchall():
            self.con.execute('INSERT OR IGNORE INTO photos (rkmaster_id, filename) VALUES (?, ?)', [row['id'], row['filename']])
            descr    = strip_junk(row['note'])
            phrases  = set(get_all_phrases(descr))
            tags     = phrases & categories
            for tag in tags:
                self.con.execute('INSERT OR IGNORE INTO labels (provider, photo_id, label, confidence) VALUES ("photos.app", ?, ?, 1.0)', [ row['id'], tag ])

    def __enter__(self):
        return self

    def __exit__(self, exc_type, exc_value, traceback):
        self.close()
        return False # "return True" suppresses Exception

    def close(self):
        self.con.commit()
        self.con.close()


def clarifai(db):
    '''Go through and upload/tag images with Clarifai (keep going until error.)'''

    c6i = ClarifaiApp(api_key=os.environ['CLARIFAI_API_KEY'])
    model = c6i.models.get('general-v1.3')

    for row in db.query('SELECT * FROM photos WHERE clarifai IS NULL'):
        img_path = db.photos_lib_path + '/Masters/' + row['filename']
        print(img_path)

        # first try to classify the image, but bail if we don't have a /valid/ response
        try:

            # bizarrely enough, the official Clarifai SDK base64-encodes images
            # which I wouldn't have known if not for bumping repeatedly into
            # their maximum allowed payload size: 10485760 bytes
            if not re.match(r'.*(jpg|JPG)$', img_path) or os.stat(img_path).st_size * 4/3 > 10485760:
                continue
            img = Image(file_obj=open(img_path, 'rb'))
            response = model.predict([img])
            if response['status']['code'] == 10000:
                labels = { c['name'] : c['value'] for c in response['outputs'][0]['data']['concepts'] }
                status = 1
            else:
                labels = {}
                status = 2
            print(labels)
        except:
            raise

        # update database with new labels
        for label, confidence in labels.items():
            db.con.execute('INSERT OR IGNORE INTO labels (provider, photo_id, label, confidence) VALUES ("clarifai", ?, ?, ?)', [ row['id'], label, confidence])
        db.con.execute('UPDATE photos SET clarifai = ? WHERE id = ?', [status, row['id']])
        db.con.commit()

        if status != 1:
            print('bad status')
            exit(1)


class Label:
    def __init__(self, provider, name):
        self.name        = name
        self.provider    = provider
        self.freq        = 1

    def canonical(self):
        return self.provider + '-' + self.name

    @staticmethod
    def canonicalize(row):
        return row['provider'] + '-' + row['label']

def dump_frequency_json(db):
    labels = {}
    for r in db.query('SELECT * FROM labels LEFT JOIN photos ON labels.photo_id = photos.id WHERE photos.clarifai = 1'):
        canonical = Label.canonicalize(r)
        if canonical in labels and labels[canonical] != None:
            labels[canonical].freq += 1
        else:
            labels[canonical] = Label(r['provider'], r['label'])

    _ = []
    for c, label in labels.items():
        _.append({ 'name' : label.name, 'provider' : label.provider, 'freq' : label.freq})
    print(json.dumps(_))

def plist(tags):
	"""Assemble a list of tags into an xml plist"""
	plist  = '<!DOCTYPE plist PUBLIC "-//Apple//DTD PLIST 1.0//EN" '
	plist += '"http://www.apple.com/DTDs/PropertyList-1.0.dtd">'
	plist += '<plist version="1.0"><array>'
	for tag in tags:
		plist += '<string>' + tag + '</string>' 
	plist += '</array></plist>'
	return plist

def set_xattr(file, xattr, value):
	"""Write, or over-write a given xattr."""
	if subprocess.call(['xattr', '-w', xattr, value, file]) != 0:
		raise

def write_tags(file, tags):
	"""Associate a list of tags with a file."""
	set_xattr(file, 'com.apple.metadata:_kMDItemUserTags', plist(tags))

def update_xattrs(db):
    images = {}
    for i in db.query('SELECT * FROM labels JOIN photos ON labels.photo_id = photos.id'):
        f = db.photos_lib_path + '/Masters/' + i['filename']
        if f in images and images[f] != None:
            images[f].add(i['label'])
        else:
            images[f] = set()
            images[f].add(i['label'])

    for filename, tags in images.items():
        write_tags(filename, list(tags))


def main():

    parser = argparse.ArgumentParser('alternative-classifiers: compare photoanalysisd tags with 3rd-party classifiers.')
    parser.add_argument('--init', action='store_const', const=True, default=False)
    parser.add_argument('--photos-db', dest='photos_db_path', required=False)
    parser.add_argument('--lib', dest='photos_lib_path', required=False)
    parser.add_argument('--clarifai', dest='clarifai', action='store_const', const=True, default=False)
    parser.add_argument('--sync', dest='sync', action='store_const', const=True, default=False)
    parser.add_argument('--db', dest='db', required=True)
    parser.add_argument('--json', dest='json', action='store_const', const=True, default=False)
    parser.add_argument('--xattrs', dest='xattrs', action='store_const', const=True, default=False)
    args = parser.parse_args()

    if args.init:
        if args.photos_db_path and args.photos_lib_path and args.db:
            DB.create(args.db, args.photos_db_path, args.photos_lib_path)
        else:
            parser.usage()
            sys.exit(1)

    if args.sync:
        with DB(args.db) as db:
            db.sync()

    if args.clarifai:
        with DB(args.db) as db:
            clarifai(db)
            
    if args.json:
        with DB(args.db) as db:
            dump_frequency_json(db)

    if args.xattrs:
        with DB(args.db) as db:
            update_xattrs(db)


def strip_junk(s):
	"""stringNotes are messy. Sometimes, they begin with Location, date, or 
	filename information. The order is variable, but tags seem to come last.
	Street names and locations are often collide with valid tags, e.g. 
	"Mountain View, Ca" matches "Mountain." """
	idx = 0
	for pat in [ r"\s+[0-9][0-9][0-9][0-9]\s+",
		     r"\s+[0-9][0-9][0-9][0-9]$",
		     r"^[0-9][0-9][0-9][0-9]$",
		     r"\s+(N|S|E|W|NE|NW|SE|SW|Nb|Sb|Eb|Wb)\s+",
		     r"\s+(N|S|E|W|NE|NW|SE|SW|Nb|Sb|Eb|Wb)$",
		     r"\s+(St|Ave|Ln|Pkwy|Blvd|Trl|Vw|Hwy|Way|Rd|Dr)\s+",
		     r"\s+(St|Ave|Ln|Pkwy|Blvd|Trl|Vw|Hwy|Way|Rd|Dr)$",
		     r"(JPG|ARW|JPEG|jpg|arw|jpeg)" ]:
		for match_end_idx in [ m.end() for m in re.finditer(pat, s)]:
			idx = match_end_idx if match_end_idx > idx else idx
	return s[idx:]

# for handling n-gram tags (thanks to haikuginger)
def get_all_phrases(s):
	words = s.split()
	if len(words) == 1:
		return words
	phrases = []
	for i in range(2, len(words) + 1):
		phrases += get_phrases_of_len(i, words)
	return words + phrases

def get_phrases_of_len(length, words):
	return [' '.join(words[i:i+length]) for i in range((len(words) - length) + 1)]

